import './style/Nav.css';
import logo from './images/logo.png';
import blurp from './images/blurp.png';

import React, {useState} from 'react';
import {Link} from 'react-router-dom';

function Nav()
{
    const [name, setName] = useState("");

    return(
        <nav className="navbar navbar-expand-lg nav">
            <div className="container-fluid">
                <a className="navbar-brand" href="#">
                    <Link to='/' className='logo-block'>
                        <img className='navbar-brand logo' src={logo} alt='T_T'/>
                        <img className=' blurp' src={blurp} alt='T_T'/>
                    </Link>
                </a>
                <button className="navbar-toggler" type="button" data-bs-toggle="collapse"
                        data-bs-target="#navbarTogglerDemo02" aria-controls="navbarTogglerDemo02" aria-expanded="false"
                        aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                </button>
                <div className="collapse navbar-collapse" id="navbarTogglerDemo02">
                    <ul className='navbar-nav me-auto mb-2 mb-lg-0 size'>
                        <li className='nav-item'><Link className='nav-link text-dark' to='/'>Home</Link></li>
                        <li className='nav-item'><Link className='nav-link text-dark' to='/ingredients'>Ingredients</Link></li>
                        <li className='nav-item'><Link className='nav-link text-dark' to='/user'>User</Link></li>

                    </ul>
                    <form className="d-flex right" role="search" action={`/recipes/search/${name}`}>
                        <input className="form-control me-2" type='text' placeholder="Search" value={name} onChange={e => setName(e.target.value)}aria-label="Search"/>
                            <button className="btn btn-outline-success" type="submit">Search</button>
                    </form>
                </div>
            </div>
        </nav>
    );
}

export default Nav;
